data:
  definition: ensemble de niveaux de tension compris entre la basse et la haute tension
  examples: []
  notes:
  - Les frontières entre moyenne et haute tension sont imprécises et dépendent de
    circonstances locales et historiques ou de l'usage courant. Il est toutefois généralement
    admis que ces frontières se situent entre 30 kV et 100 kV.
